webpackJsonp([0xa98e8eba5b7d],{4957:function(e,t){e.exports={pathContext:{group:[{node:{fields:{title:"The Captured Flea (or The Prisoner Fled)",date:"21 Aug 2006",slug:"/2006-08-21-the-captured-flea-or-the-prisoner-fled/",tags:"Y2006"},html:'<p>You might think German is such a precise language, with all the genders and spellings for noun cases, that capitalizing nouns is a waste of time. Not so... <a href="http://bronski.net/archiv/2006/08/08/gross-und-kleinschreibung/" title="[bronski.net] » Archiv » Gross- und Kleinschreibung">bronksi.net</a> has some examples involving birds, spiders, blisters and fleas of why it\'s important to mind the capitalization.</p>'},next:{fields:{title:"Ciao Bella Open Air",date:"19 Aug 2006",slug:"/2006-08-19-ciao-bella-open-air/"}},previous:{fields:{title:"Captain Christopher",date:"24 Aug 2006",slug:"/2006-08-24-captain-christopher/"}}},{node:{fields:{title:"Ciao Bella Open Air",date:"19 Aug 2006",slug:"/2006-08-19-ciao-bella-open-air/",tags:"Y2006"},html:'<p>Just 24 hours after our return to Germany, our neighbor is holding an <a href="http://www.soulfulrock.de/" title="Ciao Bella - Soulful Rock from the Heart of Texas">open-air</a> <a href="http://www.abendblatt.de/daten/2006/08/09/595917.html">concert</a> in his farmyard, with the band <a href="http://www.myspace.com/ciaobellaband">Ciao Bella</a> touring from Texas. We\'ve never had any concerts in Lüllau that I can recall.</p>\n<p>Maybe I should offer not to report the noise to the police in return for free beer.</p>'},next:{fields:{title:"Back Again",date:"18 Aug 2006",slug:"/2006-08-18-back-again/"}},previous:{fields:{title:"The Captured Flea (or The Prisoner Fled)",date:"21 Aug 2006",slug:"/2006-08-21-the-captured-flea-or-the-prisoner-fled/"}}},{node:{fields:{title:"Back Again",date:"18 Aug 2006",slug:"/2006-08-18-back-again/",tags:"Y2006"},html:"<p>We're back in Germany, in body if not yet in spirit. The brain takes a couple of days to catch up.</p>\n<p>Our return with Northwest Airlines was a mixed bag. Internet check-in and seat selection is cool. Flying 25-year-old DC-10s in this day and age is not. We arrived 3 hours before take-off, taking the travel advisories into consideration, but despite the warnings ecurity was so fast we ended up consuming liquids in the airport bar for 2 hours before boarding.</p>"},next:{fields:{title:"My Brother Dave",date:"11 Aug 2006",slug:"/2006-08-11-my-brother-dave/"}},previous:{fields:{title:"Ciao Bella Open Air",date:"19 Aug 2006",slug:"/2006-08-19-ciao-bella-open-air/"}}}],pathPrefix:"",first:!1,last:!1,index:199,pageCount:1101}}}});
